package team.shiva.shivalib.tablist.util;

import com.mojang.authlib.properties.Property;

public enum TabIcon
{
    GREY("", ""),
    YELLOW("", ""),
    WHITE("", "");

    private String iconTexture;
    private String iconSignature;
    private Property property;

    private TabIcon(final String iconTexture, final String iconSignature) {
        this.iconTexture = iconTexture;
        this.iconSignature = iconSignature;
        this.property = new Property("textures", this.iconTexture, this.iconSignature);
    }

    public com.mojang.authlib.properties.Property getProperty() {
        return this.property;
    }
}
